#include<iostream>
#include<vector>
#include<map>
using namespace std;
class Solution {
public:
    map<vector<int>, bool> explored;
    int numIslands(vector<vector<char>>& grid) {
        int count = 0;
        for (int i = 0; i < grid.size(); i++) {
            for (int j = 0; j < grid[0].size(); j++) {
                if (grid[i][j] == '0' || explored[{i, j}]) continue;
                if (dfs(grid, i, j)) {
                    count++;
                }
            }
        }
        return count;
    }
    bool dfs(vector<vector<char>>& grid, int i, int j) {

        static auto inBounds = [grid](int row, int col){
            return (row >= 0) && (row < grid.size()) && (col >= 0) && (col < grid[0].size()); 
        };
        if (grid[i][j] != '1') {
            return false;
        }
        explored[{i, j}] = true;
        /*if (i - 1 >= 0 && !explored[{i-1,j}])
            dfs(grid, i - 1, j);
        if (i + 1 < grid.size() && !explored[{i+1,j}])
            dfs(grid, i + 1, j);
        if (j - 1 >= 0 && !explored[{i,j-1}])
            dfs(grid, i, j - 1);
        if (j + 1 < grid[0].size() && !explored[{i, j + 1}])
            dfs(grid, i, j + 1);
*/
        static int rdv[]{+1,-1,0,0}; // row direction vector
        static int cdv[]{0,0,-1,+1}; // col direction vector
        for(int k = 0; k < 4; k++){
            if(inBounds(i+rdv[k],j+cdv[k]) && !explored[{i+rdv[k],j+cdv[k]}]){
                dfs(grid,i+rdv[k],j+cdv[k]);
            }           
        }

        return true;
    }
};
